     <Router>
       <div>
         <nav>

         <Link to="/" activeClassName="nav-active">{Home}</Link>

          <Link to="/about" activeClassName="nav-active">{About}</Link>


         </nav>
       </div>
        <routes>
          <Route path="/about" element={ <About />} />
          <Route  path="*"     element={< NotFound />} />
          <Route path="/"      element={< Home />} />
       </routes>
     </Router>


  );
}

export default App;
